// src/components/PropertyCard.tsx
import React from "react";
import { Property } from "../types";

interface PropertyCardProps {
  property: Property;
}

const PropertyCard: React.FC<PropertyCardProps> = ({ property }) => {
  return (
    <div className="border rounded-lg shadow-md overflow-hidden p-4 bg-white">
      <img
        src={property.image}
        alt={property.title}
        className="w-full h-48 object-cover rounded-md mb-3"
      />
      <h2 className="text-xl font-semibold mb-1">{property.title}</h2>
      <p className="text-gray-500 mb-2">{property.location}</p>
      <p className="text-gray-700 font-bold mb-2">
        ${property.price.toLocaleString()}
      </p>
      <p className="text-sm text-gray-600 mb-1">
        {property.bedrooms} beds • {property.bathrooms} baths • {property.size}{" "}
        m²
      </p>
      <p className="text-sm text-gray-500">
        {property.transaction === "rent" ? "For Rent" : "For Sale"}
      </p>
    </div>
  );
};

export default PropertyCard;
